		return $service;
	}


	/**
	 * @return RouterFactory
	 */
	protected function createServiceRouterFactory()
	{
		$service = new RouterFactory;
		return $service;
	}


	/**
	 * @return NSession
	 */
	protected function createServiceSession()
	{
		$service = new NSession($this->getService('httpRequest'), $this->getService('httpResponse'));
		return $service;
	}


	/**
	 * @return SkolaModel
	 */
	protected function createServiceSkolaModel()
	{
		$service = new SkolaModel($this->getService('nette.database.default'));
		return $service;
	}


	/**
	 * @return sponzorModel
	 */
	protected function createServiceSponzorModel()
	{
		$service = new SponzorModel($this->getService('nette.database.default'));
		if (!$service instanceof sponzorModel) {
			throw new UnexpectedValueException('Unable to create service \'sponzorModel\', value returned by factory is not sponzorModel type.');
		}
		return $service;
	}


	/**
	 * @return NUser
	 */
	protected function createServiceUser()
	{
		$service = new NUser($this->getService('nette.userStorage'), $this);
		NDebugger::$bar->addPanel(new NUserPanel($service));
		return $service;
	}


	public function initialize()
	{
		date_default_timezone_set('Europe/Prague');
		NFileStorage::$useDirectories = TRUE;

		$this->session->exists() && $this->session->start();
		header('X-Frame-Options: SAMEORIGIN');
	}

}



